import React from 'react'

function Basket(){
    let basketProduct = JSON.parse(localStorage.getItem('basket')) || []
    
    return(
        <>
       {basketProduct.map(item=>{
           return(
               <>
           
           <h2>{item.title}</h2>
           <img src={`.${item.image}`}/>
           <p>{item.description}</p>
           
           </>
            )
       })}
       </>
    )
}

export default Basket
